pragma solidity ^0.5.15;

// Maker
import "./maker/Common.sol";
import "./maker/GemJoinLike.sol";
import "./maker/JugLike.sol";
import "./maker/ManagerLike.sol";
import "./maker/VatLike.sol";

// Aave
import "./aave/FlashLoanReceiverBase.sol";
import "./aave/ILendingPoolAddressesProvider.sol";
import "./aave/ILendingPool.sol";

// Uniswap
import "./Uniswap/IUniswapExchange.sol";
import "./Uniswap/IUniswapFactory.sol";

contract SwapActions is Common, FlashLoanReceiverBase {

    using SafeMath for uint256;

    address public dlabsAddress = 0xA8e36b688eC3741e18D4F9f3AFBFA7f0F9f0662A;

    // Events

    event Swapped(
        address cdpOwner,
        uint oldCdpId,
        uint newCdpId,
        uint oldCollAmt,
        address oldCollAddress,
        uint newCollAmt,
        address newCollAddress
    );

    // STRUCTs
    struct CalldataVars {
        address usrProxy;
        uint cdpId;
        address newCollateralAddress;
        address oldCollateralAddress;
        address cdpManager;
        address ethJoin;
        address daiJoin;
        address gemJoin;
        address jug;
        bytes32 ilk;
    }

    // Needs to be payable to accept ETH for flashloaning ETH
    function() external payable { }

    // INTERNAL - Pure

    function sub(uint x, uint y) internal pure returns (uint z) {
        require((z = x - y) <= x, "sub-overflow");
    }

    function toInt(uint x) internal pure returns (int y) {
        y = int(x);
        require(y >= 0, "int-overflow");
    }

    function toRad(uint wad) internal pure returns (uint rad) {
        rad = mul(wad, 10 ** 27);
    }

    // A hacky way to avoid 'Stack too deep' errors
    function _decode(bytes memory params) internal pure returns (CalldataVars memory vars) {
        (address usrProxy, uint cdpId, address newCollateralAddress, address oldCollateralAddress, address cdpManager, address ethJoin, address daiJoin, address gemJoin, address jug, bytes32 ilk) = abi.decode(params, (address, uint, address, address, address, address, address, address, address, bytes32));
        vars.usrProxy = usrProxy;
        vars.cdpId = cdpId;
        vars.newCollateralAddress = newCollateralAddress;
        vars.oldCollateralAddress = oldCollateralAddress;
        vars.cdpManager = cdpManager;
        vars.ethJoin = ethJoin;
        vars.daiJoin = daiJoin;
        vars.gemJoin = gemJoin;
        vars.jug = jug;
        vars.ilk = ilk;

        return vars;
    }

    // INTERNAL - MKR

    function _convertTo18(address gemJoin, uint256 amt) internal returns (uint256 wad) {
        // For those collaterals that have less than 18 decimals precision we need to do the conversion before passing to frob function
        // Adapters will automatically handle the difference of precision
        wad = mul(
            amt,
            10 ** (18 - GemJoinLike(gemJoin).dec())
        );
    }

    function _cdpAllow(
        address manager,
        uint cdp,
        address usr,
        uint ok
    ) internal {
        ManagerLike(manager).cdpAllow(cdp, usr, ok);
    }

    function _ethJoin_join(address apt, address urn, uint wadC) internal {
        // Wraps ETH in WETH
        GemJoinLike(apt).gem().deposit.value(wadC)();
        // Approves adapter to take the WETH amount
        GemJoinLike(apt).gem().approve(address(apt), wadC);
        // Joins WETH collateral into the vat
        GemJoinLike(apt).join(urn, wadC);
    }

    function _flux(
        address manager,
        uint cdp,
        address dst,
        uint wad
    ) internal {
        ManagerLike(manager).flux(cdp, dst, wad);
    }

    function _frob(
        address manager,
        uint cdp,
        int dink,
        int dart
    ) internal {
        ManagerLike(manager).frob(cdp, dink, dart);
    }

    function _gemJoin_join(address apt, address urn, uint wad) internal {
        // Approves adapter to take the token amount
        GemJoinLike(apt).gem().approve(apt, wad);
        // Joins token collateral into the vat
        GemJoinLike(apt).join(urn, wad);
    }

    function _getDrawDart(
        address vat,
        address jug,
        address urn,
        bytes32 ilk,
        uint wad
    ) internal returns (int dart) {
        // Updates stability fee rate
        uint rate = JugLike(jug).drip(ilk);
        // Gets DAI balance of the urn in the vat
        uint dai = VatLike(vat).dai(urn);
        // If there was already enough DAI in the vat balance, just exits it without adding more debt
        if (dai < mul(wad, RAY)) {
            // Calculates the needed dart so together with the existing dai in the vat is enough to exit wad amount of DAI tokens
            dart = toInt(sub(mul(wad, RAY), dai) / rate);
            // This is neeeded due lack of precision. It might need to sum an extra dart wei (for the given DAI wad amount)
            dart = mul(uint(dart), rate) < mul(wad, RAY) ? dart + 1 : dart;
        }
    }

    // ink = collateral, art = normalised debt, actual debt = art * rate
    function _getDebt(
        address manager,
        uint cdp
    )
        internal
        view
        returns (uint debt)
    {
        address vat = ManagerLike(manager).vat();
        address urn = ManagerLike(manager).urns(cdp);
        bytes32 ilk = ManagerLike(manager).ilks(cdp);
        address owner = ManagerLike(manager).owns(cdp);

        debt = _getWipeAllWad(vat, owner, urn, ilk);
    }

    function _getWipeAllWad(
        address vat,
        address usr,
        address urn,
        bytes32 ilk
    ) internal view returns (uint wad) {
        // Gets actual rate from the vat
        (, uint rate,,,) = VatLike(vat).ilks(ilk);
        // Gets actual art value of the urn
        (, uint art) = VatLike(vat).urns(ilk, urn);
        // Gets actual dai amount in the urn
        uint dai = VatLike(vat).dai(usr);

        uint rad = sub(mul(art, rate), dai);
        wad = rad / RAY;

        // If the rad precision has some dust, it will need to request for 1 extra wad wei
        wad = mul(wad, RAY) < rad ? wad + 1 : wad;
    }

    function _give(
        address manager,
        uint cdp,
        address usr
    ) internal {
        ManagerLike(manager).give(cdp, usr);
    }

    function _move(
        address manager,
        uint cdp,
        address dst,
        uint rad
    ) internal {
        ManagerLike(manager).move(cdp, dst, rad);
    }

    function _open(
        address manager,
        bytes32 ilk,
        address usr
    ) internal returns (uint cdp) {
        cdp = ManagerLike(manager).open(ilk, usr);
    }

    // ETH collateral --> Gem collateral

    function _wipeAllAndFreeETH(
        address manager,
        address ethJoin,
        address daiJoin,
        uint cdp
    )
        internal
        returns (uint)
    {
        address vat = ManagerLike(manager).vat();
        address urn = ManagerLike(manager).urns(cdp);
        bytes32 ilk = ManagerLike(manager).ilks(cdp);
        (uint ink, uint art) = VatLike(vat).urns(ilk, urn);

        // Joins DAI amount into the vat
        daiJoin_join(daiJoin, urn, _getWipeAllWad(vat, urn, urn, ilk));
        // Paybacks debt to the CDP and unlocks WETH amount from it
        _frob(
            manager,
            cdp,
            -toInt(ink),
            -int(art)
        );
        // Moves the amount from the CDP urn to proxy's address
        _flux(manager, cdp, address(this), ink);
        // Exits WETH amount to proxy address as a token
        GemJoinLike(ethJoin).exit(address(this), ink);
        // Converts WETH to ETH
        GemJoinLike(ethJoin).gem().withdraw(ink);
        return ink;
    }

    function _openLockGemAndDraw(
        address manager,
        address jug,
        address gemJoin,
        address daiJoin,
        bytes32 ilk,
        uint wadC,
        uint wadD
    )
        internal
        returns (uint cdp)
    {
        // Open a new CDP
        cdp = _open(manager, ilk, address(this));

        address urn = ManagerLike(manager).urns(cdp);
        address vat = ManagerLike(manager).vat();
        // Takes token amount from user's wallet and joins into the vat
        _gemJoin_join(gemJoin, urn, wadC);
        // Locks token amount into the CDP and generates debt
        _frob(manager, cdp, toInt(_convertTo18(gemJoin, wadC)), _getDrawDart(vat, jug, urn, ilk, wadD));
        // Moves the DAI amount (balance in the vat in rad) to this address
        _move(manager, cdp, address(this), toRad(wadD));
        // Allows adapter to access to proxy's DAI balance in the vat
        if (VatLike(vat).can(address(this), address(daiJoin)) == 0) {
            VatLike(vat).hope(daiJoin);
        }
        // Exits DAI to the user's wallet as a token
        DaiJoinLike(daiJoin).exit(address(this), wadD);
    }

    // Gem collateral --> ETH collateral

    function _wipeAllAndFreeGem(
        address manager,
        address gemJoin,
        address daiJoin,
        uint cdp
    ) internal returns (uint) {
        address vat = ManagerLike(manager).vat();
        address urn = ManagerLike(manager).urns(cdp);
        bytes32 ilk = ManagerLike(manager).ilks(cdp);
        (uint ink, uint art) = VatLike(vat).urns(ilk, urn);

        // Joins DAI amount into the vat
        daiJoin_join(daiJoin, urn, _getWipeAllWad(vat, urn, urn, ilk));
        uint wad18 = _convertTo18(gemJoin, ink);
        // Paybacks debt to the CDP and unlocks token amount from it
        _frob(
            manager,
            cdp,
            -toInt(wad18),
            -int(art)
        );
        // Moves the amount from the CDP urn to proxy's address
        _flux(manager, cdp, address(this), wad18);
        // Exits token amount to the user's wallet as a token
        GemJoinLike(gemJoin).exit(address(this), ink);
        return ink;
    }

    function _openLockETHAndDraw(
        address manager,
        address jug,
        address ethJoin,
        address daiJoin,
        bytes32 ilk,
        uint wadC,
        uint wadD
    )
        internal
        returns (uint cdp)
    {
        cdp = _open(manager, ilk, address(this));

        address urn = ManagerLike(manager).urns(cdp);
        address vat = ManagerLike(manager).vat();
        // Receives ETH amount, converts it to WETH and joins it into the vat
        _ethJoin_join(ethJoin, urn, wadC);
        // Locks WETH amount into the CDP and generates debt
        _frob(manager, cdp, toInt(wadC), _getDrawDart(vat, jug, urn, ilk, wadD));
        // Moves the DAI amount (balance in the vat in rad) to proxy's address
        _move(manager, cdp, address(this), toRad(wadD));
        // Allows adapter to access to proxy's DAI balance in the vat
        if (VatLike(vat).can(address(this), address(daiJoin)) == 0) {
            VatLike(vat).hope(daiJoin);
        }
        // Exits DAI to the user's wallet as a token
        DaiJoinLike(daiJoin).exit(address(this), wadD);
    }

    // INTERNAL - Uniswap

    function _getUniswapExchange(address tokenAddress) internal view returns (address exchangeAddress) {
        IUniswapFactory uniswapFactory = IUniswapFactory(0xc0a47dFe034B400B47bDaD5FecDa2621de6c4d95); // Mainnet address
        exchangeAddress = uniswapFactory.getExchange(tokenAddress);
    }

    function _buyTokensWithEthFromUniswap(address tokenAddress, uint ethAmount) internal returns (uint tokensAmount) {
        IUniswapExchange newGemEx = IUniswapExchange(_getUniswapExchange(tokenAddress));
        tokensAmount = newGemEx.ethToTokenSwapInput.value(ethAmount)(uint(1), uint(now + 60));
    }

    function _sellTokensForEthFromUniswap(address tokenAddress, uint tokenAmount) internal returns (uint ethAmount) {
        IUniswapExchange newGemEx = IUniswapExchange(_getUniswapExchange(tokenAddress));
        IERC20(tokenAddress).approve(address(newGemEx), tokenAmount);
        ethAmount = newGemEx.tokenToEthSwapInput(tokenAmount, uint(1), uint(now + 60));
    }

    // EXTERNAL

    /**
        Called by Aave's LendingPool.flashLoan() function.
     */
    function executeOperation(
        address _reserve,
        uint256 _amount,
        uint256 _fee,
        bytes calldata _params
    )
        external
    {
        require(_amount <= getBalanceInternal(address(this), _reserve), "Invalid balance, was the flashLoan successful?");

        CalldataVars memory vars = _decode(_params);
        uint debt = _amount.add(_fee);
        uint dlabsFeeBps = _fee.div(uint(2));

        uint oldCollateralAmt;
        uint newCollateralAmt;
        uint newCdpId;

        // 1. Close the cdp with flashloaned asset amount (now in SwapActions contract)
        // 2. ... collateral is free, swap collateral (e.g. ETH) on uniswap for desired newCollateral (e.g. BAT)
        // 3. ... we have newCollateral, open a new CDP with new collateral and draw the debt amount

        if (vars.newCollateralAddress == EthAddressLib.ethAddress()) {
            oldCollateralAmt = _wipeAllAndFreeGem(vars.cdpManager, vars.gemJoin, vars.daiJoin, vars.cdpId);
            newCollateralAmt = _sellTokensForEthFromUniswap(vars.oldCollateralAddress, oldCollateralAmt);
            newCdpId = _openLockETHAndDraw(vars.cdpManager, vars.jug, vars.ethJoin, vars.daiJoin, vars.ilk, newCollateralAmt, debt.add(dlabsFeeBps));
        } else {
            oldCollateralAmt = _wipeAllAndFreeETH(vars.cdpManager, vars.ethJoin, vars.daiJoin, vars.cdpId);
            newCollateralAmt = _buyTokensWithEthFromUniswap(vars.newCollateralAddress, oldCollateralAmt);
            newCdpId = _openLockGemAndDraw(vars.cdpManager, vars.jug, vars.gemJoin, vars.daiJoin, vars.ilk, newCollateralAmt, debt.add(dlabsFeeBps));
        }

        // ... TODO: check that it won't be over liquidation price with drawing this debt amount

        // ... give new CDP to user's proxy
        _give(vars.cdpManager, newCdpId, vars.usrProxy);

        // ... do no evil with old CDP
        _cdpAllow(vars.cdpManager, vars.cdpId, address(this), 0);

        // ... payback the flashLoan
        transferFundsBackToPoolInternal(_reserve, debt);

        // ... payout dlabs fee
        IERC20(_reserve).transfer(dlabsAddress, dlabsFeeBps);

        emit Swapped(vars.usrProxy, vars.cdpId, newCdpId, oldCollateralAmt, vars.oldCollateralAddress, newCollateralAmt, vars.newCollateralAddress);
    }

    // PUBLIC

    /**
        `data` should have the following values encoded in this order:
            [
                usrProxy,
                cdpId,
                newCollateralAddress,
                oldCollateralAddress,
                cdpManager,
                ethJoin,
                daiJoin,
                gemJoin,
                jug,
                ilk
            ]
     */
    function swapCollateral(
        address cdpManager,
        address swapContract,
        address borrowAssetAddress, // always DAI
        uint cdp,
        bytes memory data
    ) public {
        // Enable our contract to close the CDP in question
        _cdpAllow(cdpManager, cdp, swapContract, 1);

        // Get amount of DAI debt for CDP
        uint debt = _getDebt(cdpManager, cdp);

        // Get the Aave lending pool instance
        // address lendingPoolAddress = addressesProvider.getLendingPool(); // ???? not working during testing ????
        ILendingPool lendingPool = ILendingPool(ILendingPoolAddressesProvider(0x24a42fD28C976A61Df5D00D0599C34c4f90748c8).getLendingPool());

        // Perform the flashLoan, lendingPool will call `executeOperation()`
        lendingPool.flashLoan(swapContract, borrowAssetAddress, debt, data);
    }

    function getCDPInfo(address cdpManager, uint cdp) public view returns (uint debt, address owner) {
        debt = _getDebt(cdpManager, cdp);
        owner = ManagerLike(cdpManager).owns(cdp);
    }
}
